document.addEventListener("DOMContentLoaded",()=>{let i=Array.from(document.querySelectorAll(".menus-section .menu-card img"));if(0!==i.length){let n=0,r=1/0;i.forEach(t=>{var e=()=>{var e=t.clientHeight||t.naturalHeight;0<e&&(r=Math.min(r,e)),++n===i.length&&isFinite(r)&&i.forEach(e=>{e.style.height=r+"px",e.style.objectFit="contain"})};t.complete?e():(t.addEventListener("load",e),t.addEventListener("error",e))})}});